// import logo from "./logo.svg";
import React from "react";
import { BrowserRouter as Router, Route } from "react-router-dom";
import Users from "./User/Pages/User.jsx";
import "./App.css";

function App() {
  return (
    <Router>
      <Route path="/" exact>
        <Users />
      </Route>
      {/* <Redirect to="/" /> */}
    </Router>
  );
}

export default App;
